import { Container, Row, Col } from 'react-bootstrap';
import Header from './Header';
import List from './List';
import Content from './Content';

function App() {
  return (
    <div>
      <Header />


      <Container>
        <Row>
          <Col xs={12} md={3}>
            <List />
          </Col>
          <Col xs={12} md={9}>
            <Content />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
